import { actionTypes } from '../actions/actionTypes';

function activeWorkoutReducer(state = null, action) {
  switch (action.type) {
    case actionTypes.SET_INITIAL_PROGRAM:
      console.log(
        'SET_INITIAL_PROGRAM in activeWorkoutReducer. Payload:',
        action.payload
      );
      return action.payload.workouts[0].id;

    case actionTypes.SET_ACTIVE_WORKOUT:
      return action.payload;

    default:
      return state;
  }
}

export { activeWorkoutReducer };
